import logo from './logo.svg';
import './App.css';

function App() {

  let cantidad =2

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <IntroText name="Lista de tareas" count={cantidad} />
        <a 
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function IntroText ({name,count}){
  return (
    <p>
      Edit <code>src/App.js</code>  <br/>
      {name} {count}<br/> 
      sadasdasda and save to reload, SARASA.
    </p>
  ) 
}

export default App;
